import React from 'react';
 import { Link } from 'react-router-dom';
import menuData from '../data/menu.json';

const Menu = () => (
<nav>
<ul>
{menuData.map(item => (
<li key={item.path}>
<Link to={item.path}>{item.name}</Link>
</li>
))}
</ul>
</nav>
);

export default Menu;
